// Statically returns 27994 deposited keys for ethereum 2.0 mainnet
// Note that all of them belong to kraken
// To be used just for testing, where multiple keys are needed
func GetMainnet27994Keys() [][]byte {
	depositedKeys := make([][]byte, 0)

	for _, keyStr := range keysStr {
		key, err := hexutil.Decode(keyStr)
		depositedKeys = append(depositedKeys, key)
		if err != nil {
			log.Fatal(keyStr, ": ", err)
		}
	}
	return depositedKeys
}
